import React from 'react'

const Skill = () => {
  return (
   <section className="skills section" id="skills">
     <h2 className="section-title">Skills</h2>
        <span className="section-subtitle">
            My Technical skills
        </span>

        .skill-container.container.g
   </section>
  )
}

export default Skill
